private static int countCaseTokens(DetailAST ast) {
    int counter = 0;
    for (DetailAST iterator = ast.getFirstChild(); iterator != null;
            iterator = iterator.getNextSibling()) {
        if (iterator.getType() == TokenTypes.LITERAL_CASE) {
            counter++;
        }
    }
    return counter;
}
